import React from "react";
import "../support.css";
import Grid from '@material-ui/core/Grid';


function App() {
    return (
        <Grid container spacing={1}>
            <Grid container item xs={12} spacing={3}>
                MERHABA
            </Grid>
            <Grid container item xs={12} spacing={3}>
                MERHABA
            </Grid>
            <Grid container item xs={12} spacing={3}>
                MERHABA
            </Grid>
            <Grid container item xs={12} spacing={3}>
                MERHABA
            </Grid>
            <Grid container item xs={12} spacing={3}>
                SADF
            </Grid>
            <Grid container item xs={12} spacing={3}>
                ADSFASD
            </Grid>
        </Grid>
    );
}


export default App;
